import React from 'react';
import Navbar from './_share/Navbar.js';
import Main_content from './_share/Main_content.js';
import Footer from './_share/Footer.js';

const Customer_layout = ({ section }) => {
	return (
		<>
			<div className="site-wrap">
				<Navbar />
				<Main_content section={section} />
				<Footer />
			</div>
			<script src="/template_frontend/js/jquery-3.3.1.min.js"></script>
		    <script src="/template_frontend/js/jquery-ui.js"></script>
		    <script src="/template_frontend/js/popper.min.js"></script>
		    <script src="/template_frontend/js/bootstrap.min.js"></script>
		    <script src="/template_frontend/js/owl.carousel.min.js"></script>
		    <script src="/template_frontend/js/jquery.magnific-popup.min.js"></script>
		    <script src="/template_frontend/js/aos.js"></script>
		    <script src="/template_frontend/js/main.js"></script>
		</>
	)
}

export default Customer_layout
